import React from "react";
import "./ExtraLink.css";
import Link from "../../../ui/Link";

export default function ExtraLink() {
  return (
    <div className="extra-link inline-block">
      <h2 className="extra-info-header">Recipes by Ingredient</h2>
      <p className="extra-info-text">
        Narrow your search by main ingredient to find recipes and meal ideas
        fast:
        <Link
          target="_blank"
          rel="noopener noreferrer"
          href="https://www.myrecipes.com/ingredients"
          text="myrecipes.com"
        />
      </p>
    </div>
  );
}
